import React, { useEffect } from 'react';

import HeaderAluno from '../../../components/headerAluno/index';
import Footer from '../../../components/footer/index';

import './style.css';
import Axios from 'axios';
import ReactDOM from 'react-dom';

function ConfirmacaoAluno(){

    const api = Axios.create({
        baseURL: "http://localhost:5000/api",
        headers: {
            'content-type': 'application/json',
            authorization: 'Bearer ' + localStorage.getItem("token-conectando")
        }
    })

    useEffect(() =>{
        BuscarAlunos()
    }, [])

    const BuscarAlunos = () =>{
        api.get("/Tags")
        .then(response => {
            console.log(response.data)

        })
    }

    const ModeloTags = (tags:any) => {
        return (
            <div>
                {tags.map((t:any) => (
                    <>
                        <p></p>
                    </>
                ))}
            </div>
        )
    }


    return(
        <div>
            <HeaderAluno/>
            <div>
                <div className="div-menu">
                    <h1>Confirmação</h1>
                    <h1 className="sublinhar">Cadastro</h1>
                </div>

                <div id="tagsBuscadas">

                </div>
            </div>

            <Footer/>
        </div>
    );
}

export default ConfirmacaoAluno;
